import 'vue';
import './helpers.mjs';
import './config.mjs';
import { b as registerComponent } from './plugins-8a0db0e9.mjs';
import './Icon-b5486de5.mjs';
import './FormElementMixin-386fdfd0.mjs';
import { s as script } from './Select-2e989a42.mjs';
export { s as OSelect } from './Select-2e989a42.mjs';

var index = {
    install(app) {
        registerComponent(app, script);
    }
};

export default index;
